// src/components/Catalogo.js
import React from 'react';
import './Catalogo.css'; // Importar el CSS para el catálogo

// Datos ficticios de estampas
const estampas = [
  { id: 1, nombre: 'Estampa Dragón', precio: 50000, imagen: 'ruta/a/imagen-dragon.png' },
  { id: 2, nombre: 'Estampa Tigre', precio: 45000, imagen: 'ruta/a/imagen-tigre.png' },
  { id: 3, nombre: 'Estampa Lobo', precio: 48000, imagen: 'ruta/a/imagen-lobo.png' },
  // Agrega más estampas según sea necesario
];

function Catalog() {
  return (
    <div className="Catalogo">
      <h2>Catálogo de Estampas</h2>
      <div className="Catalogo-grid">
        {estampas.map((estampa) => (
          <div key={estampa.id} className="Catalogo-item">
            <img src={estampa.imagen} alt={estampa.nombre} />
            <h3>{estampa.nombre}</h3>
            <p>Precio: ${estampa.precio}</p>
            <button onClick={() => alert(`Seleccionaste ${estampa.nombre}`)}>
              Personalizar
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Catalogo;
